window.bookSummaryJSON = "<p> When 15-year-old Janie Johnson sees her own face in the missing children box on a milk carton, her world begins to blur. Was she kidnapped when she was a baby? Who are her parents? And who are Mr. and Mrs. Johnson? Janie’s search for the answers will lead her back 12 years into memories of another house, another family, another life. Her questions threaten to destroy the love she feels for her parents and the security they have given her. But it is a search she cannot ignore. </p> <p><i>The Face on the Milk Carton</i> has been extremely popular ever since it was first released. An IRS-CBC Children’s Choice Book, it also has been made into a frequently-aired television special. Recorded Books is proud to offer an unabridged recording of this riveting story that takes on new drama and urgency through Alyssa Bresnahan’s stirring narration.</p>"; 
